import React from "react";
import { useNavigate } from "react-router-dom";

function Home() {
    const navigate = useNavigate();
    function handleClick() {
        navigate("/About")
    }
    return(
        <button onClick={handleCLick}>this is home</button>
    )
}

export default Home;
